import './Navbar.css';
import { Link } from 'react-router-dom';
import React from 'react';

function Navbar() {
  return(
    React.createElement("header", { className: "navbar" }, 
    React.createElement("div", { className: "navbar__title navbar__item"},<Link to="/">
      <img className="logo" src="webshio.png" alt=""/> 
    </Link>),
    React.createElement("div", { className: "navbar__item"}, "Add Item", <Link to="add-item">
    </Link>), 
    React.createElement("div", { className: "navbar__item"}, "Add Category", <Link to="add-category">
    </Link>), 
    React.createElement("div", { className: "navbar__item"},<Link to="cart">
  </Link>)
  ))
}


export default Navbar
